import React from "react";
import HeroImg from "../Assets/hero-img.png"

function Hero() {
    return(
        <div className="hero-container flex flex-row justify-center">
            <div className="left-container">
                <div className="title-container">
                    <h1 className="font-serif text-7xl text-slate-700">Sprinkle & Dash</h1>
                    <p className="text-xl mt-5 pl-2 text-slate-600">Dishes from around the world brough to you...</p>
                </div>
            </div>
            <div className="right-container">
                <div className="image-container max-w-6xl">
                    <img src={HeroImg} alt="Pesto Pasta" />
                </div>
            </div>
        </div>
    )
}

export default Hero;
